import React, { useState } from 'react'

const Favorit = () => {
    const [noEmpty, useNoEmpty] = useState(false)
    return (
        <div className="myContainer">
            {noEmpty ?
                <div>
                    ffffffff
                </div>
                :
                <div>
                    aaaa
                </div>
            }
        </div>
    )
}

export default Favorit;
